import React from 'react';
import 'katex/dist/katex.min.css';
import { InlineMath, BlockMath } from 'react-katex';

function Post() {
  return (
    <>
      <h2>
        Where We Are Now
      </h2>
      <h3>
        The Past
      </h3>

      <iframe width="560" height="315" src="https://www.youtube.com/embed/l6i-gYRAwM0" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>

      <iframe width="560" height="315" src="https://www.youtube.com/embed/NRCWbFFRpnY" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>

    </>
  );
}

export default Post;
